-- ----------------------------
-- Table structure for mxg_teacher
-- ----------------------------
DROP TABLE IF EXISTS `mxg_teacher`;
CREATE TABLE `mxg_teacher`  (
  `id` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户 ID',
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '教师名字',
  `post` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '教师职位',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `fk_teacher_name`(`name`) USING BTREE,
  CONSTRAINT `fk_teacher_id` FOREIGN KEY (`id`) REFERENCES `sys_user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_teacher_name` FOREIGN KEY (`name`) REFERENCES `sys_user` (`username`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

