-- ----------------------------
-- Triggers structure for table mxg_student
-- ----------------------------
DROP TRIGGER IF EXISTS `insert_class`;
delimiter ;;
CREATE TRIGGER `insert_class` AFTER INSERT ON `mxg_student` FOR EACH ROW BEGIN
   DECLARE class_id VARCHAR(255);
   SET class_id = LEFT(NEW.student_id, 9);
   IF NOT EXISTS (SELECT * FROM mxg_class WHERE id = class_id) THEN
      INSERT INTO mxg_class (id)
      VALUES (class_id);
   END IF;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table sys_user
-- ----------------------------
DROP TRIGGER IF EXISTS `copy_name`;
delimiter ;;
CREATE TRIGGER `copy_name` AFTER INSERT ON `sys_user` FOR EACH ROW BEGIN
   INSERT INTO mxg_student (id, name)
   VALUES (NEW.id, NEW.nick_name);
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
